import React from 'react';
import { styled } from 'styled-components';

const Container = styled.div`
  border: 1px solid red;
`;

const Main = () => {
  return (
    <Container>
      <Banner>
        <img src='http://m.shop1.markgonzales.cafe24.com/images/MOBILE/M-main1.jpg'/>
      </Banner>
    </Container>
  )
}

export default Main;
